not last.
Here is a legend:
'o' - whole note, lasts four beats
'o|' - half note, lasts two beats
'.|' - quater note, lasts one beat
>>> parse_music("o o| .| o| o| .| .| .| .| o o")
[4L, 2L, 1L, 2L, 2L, 1L, 1L, 1L, 1L, 4L, 4L]
*/
long[] parse_music(string music_string) {
    long[] music_array = new long[music_string.length()];
    for (int i = 0; i < music_array.length; i++) {
        music_array[i] = 0;
    }
    int start_position = 0;
    int end_position = music_string.length();
    int[] note_array = new int[music_array.length];
    for (int i = 0; i < music_array.length; i++) {
        note_array[i] = 0;
    }
    for (int i = start_position; i < end_position; i++) {
        int note_position = music_string.charAt(i);
        if (note_position == 'o') {
            note_array[note_position]++;
        } else if (note_position == 'o|') {
            note_array[note_position]--;
        } else if (note_position == '.|') {
            note_array[note_position]++;
        } else if (note_position == '.|') {
            note_array[note_position]--;
        } else {
            note_array[note_position] = 0;
        }
    }
    return music_array;
}

