The function should return the resulted string.
Examples
>>> solve("1234")
"4321"
>>> solve("ab")
"AB"
>>> solve("#a@C")
"#A@c"
*/
string solve(string s) {
    string result = "";
    string current = "";
    int i = 0;
    while (i < s.length()) {
        if (s[i] == 'a') {
            current = current + s[i];
            i++;
        } else {
            current = current + s[i];
            i++;
        }
        result += current;
    }
    return result;
}

